import React from 'react';

const Footer = () => {
  return (
    <footer className="text-center py-8 bg-black/20 text-blue-200">
      <p>
        Contact us:
        <a href="mailto:brainboltteam@gmail.com" className="text-blue-400 hover:text-blue-500 ml-2">
          brainboltteam@gmail.com
        </a>
      </p>
    </footer>
  );
};

export default Footer;
